import React from "react";
// import "./style.css"
function Footer() {
  return (
    <footer className="footer" style={{ backgroundColor:"#cd9093" ,textAlign:"center", position: "abosolute", bottom: "0", width: "100%",height: "60px",}}>
      <span style={{fontSize:"16pt"}}>Pantry 2020</span>
    </footer>
  );
}

export default Footer;
